import React from 'react';

import { Card } from 'semantic-ui-react';
import { withRouter } from 'react-router';

const DoctorCard = ({
  place_id,
  name,
  vicinity,

  rating,



  getPlaceDetails,
}) => {
  return (
    <Card onClick={(e) => getPlaceDetails(e, place_id)}>
      <Card.Content>
        <Card.Header>{name}</Card.Header>
      </Card.Content>
      <Card.Content>
        Address: {vicinity}
        <Card.Meta></Card.Meta>
        <span>Rating: {rating}</span>
      </Card.Content>
    </Card>
  );
};

export default withRouter(DoctorCard);
